import React, { useState } from "react";
import { Link, useParams, useNavigate, useLocation } from "react-router-dom";
import "./DogCafePage.css";
import DogcafeImage from "../assets/images/Dogcafe/dogcafe.png";
import DogcafeRegionList from "./DogCafeStoreList";
import DogCafeList from "../assets/images/Dogcafe/dogcafe.png";


const DogRunPage: React.FC = () => {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate('/DogCafeRegionsList');
  };

  return (
    <div style={{ textAlign: 'center', marginTop: '20px' }}>
      <h1>wan paradise</h1>
      <p onClick={handleClick} style={{ cursor: 'pointer', fontSize: '18px' }}>
        全国のドッグカフェを探す
      </p>
      <div>
        <img src={DogcafeImage} alt="ドッグランのイラスト" style={{ width: '200px' }} />
      </div>
    </div>
  );
};

export default DogcafeImage;
